def is_base64_audio(audio_str, max_duration=120000):
    try:
        audio_data = None
        try:
            audio_data = base64.b64decode(audio_str.split(",")[1])
        except IndexError:
            audio_data = base64.b64decode(audio_str)

        with BytesIO(audio_data) as audio_buffer:
            audio_array, sample_rate = librosa.load(audio_buffer, sr=24000)
            duration_ms = (len(audio_array) / float(sample_rate)) * 1000
            if duration_ms > max_duration:
                bt.logging.info(f"`reference` audio duration exceeds the maximum allowed duration")
                return False
            return True
    except Exception as e:
        bt.logging.info(f"`reference` is not a valid base64 audio: {str(e)}")
        return False

def is_valid_audio_url(url, max_duration=120000):
    try:
        response = requests.head(url, allow_redirects=True, timeout=5)
        content_type = response.headers.get('Content-Type', '')
        if 'audio' not in content_type:
            response = requests.get(url, stream=True, timeout=5)
            content_type = response.headers.get('Content-Type', '')
            if 'audio' not in content_type:
                bt.logging.info("URL is not an audio file URL")
                return False
        # Download a portion of the file to check duration
        response = requests.get(url, stream=True, timeout=5)
        audio_data = BytesIO()
        for chunk in response.iter_content(chunk_size=8192):
            audio_data.write(chunk)
            audio_data.seek(0)
            audio_array, sample_rate = librosa.load(audio_data, sr=None)
            duration_ms = (len(audio_array) / float(sample_rate)) * 1000
            if duration_ms > max_duration:
                bt.logging.info(f"URL is audio file URL, but is longer than {max_duration} ms")
                return False
        return True
    except requests.RequestException:
        bt.logging.info(f"URL is not a valid audio file URL")
        return False
class TextToSpeechCloneRequest(BaseModel):
    """Generate an audio sample from text and reference voice!"""
    alpha: float = Field(cst.DEFAULT_ALPHA ,description = "Only used for long text inputs or in case of reference speaker, determines the timbre of the speaker. Use lower values to sample style based on previous or reference speech instead of text.")
    beta: float = Field(cst.DEFAULT_BETA, description = "Only used for long text inputs or in case of reference speaker, determines the prosody of the speaker. Use lower values to sample style based on previous or reference speech instead of text.")
    diffusion_steps: int = Field(cst.DEFAULT_STEPS, description = "Number of diffusion steps to run.")
    embedding_scale: float = Field(cst.DEFAULT_EMB_SCALE, description = "Embedding scale, use higher values for pronounced emotion")
    engine: utility_models.EngineEnum = Field(
        default=utility_models.EngineEnum.STYLETTS2.value, description="The engine to use for speech cloning and generation"
    )
    text: str = Field("This is a sample recording", description="The text to generate the speech from")
    reference: str = Field("data:audio/wav;base64,base64_encoded_audio", description="Reference speaker sample as base64 audio or downloadable URL")


    class Config:
        schema_extra = {
            "examples": [
                {
                    "alpha": 0.3,
                    "beta": 0.7,
                    "diffusion_steps": 10,
                    "embedding_scale": 1.0,
                    "engine": utility_models.EngineEnum.STYLETTS2.value,
                    "text": "This is a sample recording",
                    "reference": """data:audio/wav;base64,"""
                }
            ]
        }
        use_enum_values = True
        extra = "forbid"

    @validator("text")
    def check_text_prompts_non_empty(cls, values):
        if not values:
            raise ValueError("Text prompts cannot be empty")
        if len(values) > 4000:
            raise ValueError("Text prompts cannot be longer than 4000 characters")
        return values

    @validator("reference")
    def check_reference(cls, values):
        # if is_valid_audio_url(values):
        #     return values
        if is_base64_audio(values):
            return values
        else:
            raise ValueError("Reference must be a valid base64 audio!")

    @root_validator
    def allowed_params_validator(cls, values):
        engine = values.get("engine")
        alpha = values.get("alpha")
        beta = values.get("beta")
        diffusion_steps = values.get("diffusion_steps")
        embedding_scale = values.get("embedding_scale")
        text = values.get("text")
        reference = values.get("reference")

        params_and_values = [("engine", engine), ("alpha", alpha), ("beta", beta), ("diffusion_steps", diffusion_steps),
                             ("embedding_scale", embedding_scale), ("text", text), ("reference", reference)]

        if engine not in ALLOWED_PARAMS_FOR_ENGINE:
            raise ValueError(f"Engine {engine} not supported")
        allowed_params = ALLOWED_PARAMS_FOR_ENGINE[engine]
        for param, value in params_and_values:
            if param not in allowed_params or value is None:
                continue
            checker = allowed_params[param]["checker"]
            if not checker(value):
                error_message = allowed_params[param]["error_message"]
                raise ValueError(
                    f"Invalid value {value} provided for {param}, with engine {engine}. The value {error_message}"
                )

        return values


